  const [collection, setCollection] = useState([])

  useEffect(()=>{
    fetch(url)
    .then(r=> r.json)
    .then(data => setCollection(collection))
  })



  return (
    <div>
      <YourBotArmy />
      <BotCollection />
    </div>
  )
}

